import React, { Component } from "react";

class GifCard extends Component {
  render() {
    let display;
    if (this.props.result) {
      display = this.props.result.map((e) => {
        return (
          <>
            <img src={e.imageUrl} alt={e.title} />
            <ul>
              <li>{e.title} </li>
            </ul>
          </>
        );
      });
    } else {
      display = <p>Loading...</p>;
    }
    return <div>{display}</div>;
  }
}

export default GifCard;
